import React, { Component } from 'react';
import Color from './plugins/jscolor';

/**
 * JsColor
 */
class JsColor extends Component {
	/**
	 * JsColor Constructor
	 * @param {*} props
	 */
	constructor(props) {
		console.log(Color);
	}
	render(){
		return(
			<input className="jscolor" />
		);
	}
}

export default JsColor;
